        // 마커 이미지의 이미지 주소입니다
        var imageSrc = {
            30: "img/blue.png",
            60: "img/green.png",
            100: "img/purple.png",
            200: "img/pink.png",
            500: "img/yellow.png",
            1000: "img/red.png",
            3000: "img/black.png"
        }; 

        for (var i = 0; i < positions.length; i ++) {
            
            if (positions[i+1] && !positions[i].latlng.equals(positions[i+1].latlng)) {
                // 마커 이미지의 이미지 크기 입니다
                var imageSize = new kakao.maps.Size(24, 35); 
                
                // 마커 이미지를 생성합니다    
                var markerImage = new kakao.maps.MarkerImage(imageSrc[positions[i].count], imageSize); 
               
                var marker = new kakao.maps.Marker({
                    map: map,
                    position: positions[i].latlng,
                    title: positions[i].title,
                    clickable: true,
                    image: markerImage
                })

                var content = `<div class="marker">${positions[i].title}: ${positions[i].count}</div>` // 인포윈도우에 표출될 내용으로 HTML 문자열이나 document element가 가능합니다
            
                var infowindow = new kakao.maps.InfoWindow({
                    content: content
                });

                // 마커에 mouseover 이벤트와 mouseout 이벤트를 등록합니다
                // 이벤트 리스너로는 클로저를 만들어 등록합니다 
                // for문에서 클로저를 만들어 주지 않으면 마지막 마커에만 이벤트가 등록됩니다
                kakao.maps.event.addListener(marker, 'mouseover', makeOverListener(map, marker, infowindow));
                kakao.maps.event.addListener(marker, 'mouseout', makeOutListener(infowindow));
            }

            // 인포윈도우를 표시하는 클로저를 만드는 함수입니다 
            function makeOverListener(map, marker, infowindow) {
                return function() {
                    infowindow.open(map, marker);
                };
            }

            // 인포윈도우를 닫는 클로저를 만드는 함수입니다 
            function makeOutListener(infowindow) {
                return function() {
                    infowindow.close();
                };
            }
        }
    </script>
